import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';

const ClaimList = () => {
  const [claims, setClaims] = useState([]);
  const [selectedClaim, setSelectedClaim] = useState(null);
  const [remarks, setRemarks] = useState('');
  const [isApproved, setIsApproved] = useState('');

  useEffect(() => {
    axios.get('http://localhost:8080/admin/claims', {
      headers: {
        'Authorization': 'Basic YWRtaW4xMjM6Y21z'
      }
    })
    .then(response => {
      setClaims(response.data);
    })
    .catch(error => {
      console.error('There was an error fetching the claims!', error);
    });
  }, []);

  const handleClaimClick = (claim) => {
    setSelectedClaim(claim);
  };

  const handleApproval = (id, isApproved, remarks) => {
    axios.post(`http://localhost:8080/admin/claims/${id}/approve?remarks=${remarks}&isApproved=${isApproved}`, {}, {
      headers: {
        'Authorization': 'Basic YWRtaW4xMjM6Y21z'
      }
    })
    .then(response => {
      // Update the claim status in the UI
      setClaims(claims.map(claim => claim.id === id ? { ...claim, status: isApproved ? '1' : '0' } : claim));
      setSelectedClaim(null); // Hide the details after action
    })
    .catch(error => {
      console.error('There was an error updating the claim status!', error);
    });
  };

  return (
    <div>
      <h1>Claims List</h1>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Email</th>
            <th>Amount Claimed</th>
            <th>Policy Name</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {claims.map(claim => (
            <React.Fragment key={claim.id}>
              <tr onClick={() => handleClaimClick(claim)}>
                <td>{claim.id}</td>
                <td>{claim.userEmail}</td>
                <td>{claim.amountClaimed}</td>
                <td>{claim.policyName}</td>
                <td>{claim.status === '1' ? 'Approved' : 'Denied'}</td>
                <td>
                  <Link to="#">View</Link>
                </td>
              </tr>
              {selectedClaim && selectedClaim.id === claim.id && (
                <tr>
                  <td colSpan="6">
                    <div>
                      <h2>Claim Details</h2>
                      <p><strong>Email:</strong> {claim.userEmail}</p>
                      <p><strong>Amount Claimed:</strong> {claim.amountClaimed}</p>
                      <p><strong>Policy Name:</strong> {claim.policyName}</p>
                      <p><strong>Status:</strong> {claim.status === '1' ? 'Approved' : 'Denied'}</p>
                      <div>
                        <label>
                          Remarks:
                          <input
                            type="text"
                            value={remarks}
                            onChange={(e) => setRemarks(e.target.value)}
                          />
                        </label>
                        <div>
                          <button onClick={() => handleApproval(claim.id, true, remarks)}>Approve</button>
                          <button onClick={() => handleApproval(claim.id, false, remarks)}>Reject</button>
                        </div>
                      </div>
                    </div>
                  </td>
                </tr>
              )}
            </React.Fragment>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ClaimList;
